import "./App.css";
import Home from "./Home/Home";
import {
  Routes,
  Route,
} from "react-router-dom";
import Navbar from "./Component/Navbar";
import Capsule from "./Component/Capsule";
import Dragon from "./Component/Dragon/Dragon"
import DragonInfo from "./Component/Dragon/DragonInfo";
import Crew from "./Component/Crew/Crew";
// import InfoItem from "./Component/Crew/About/InfoItem"
import Info from "./Component/Crew/About/Info"
function App() {
  return (
    <div className="App">
    {/* <> */}
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/capsules" element={<Capsule />} />
        <Route path="/dragon" element={<Dragon />} />
        {/* <Route path = "/dragon/info" element = {<DragonInfo />} /> */}
        <Route path = "/crew" element={<Crew />} />
        <Route exact path = "/about" element={<Info />} />
      </Routes>
    </div>
    // </>
  );
}

export default App;
